    var linkCheckbox = document.querySelector('.link_check');
    var needsLink = linkCheckbox.checked;
    console.log("needs link " + needsLink);
    var memberCheckboxes = document.querySelectorAll('.member_check:checked');
    var selectedMembers = [...memberCheckboxes].map(e => (e.getAttribute('value')));
    
